import React, { Component } from 'react'
import {Button} from "react-bootstrap";

 class App extends Component {
  render() {
    return (
      <div>
         <Button variant="warning">Warning</Button>
         <Button variant="info"> <i className="fafa-home"></i></Button>
      </div>
    )
  }
}

export default App
